import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/maximiseLogo.png';

const LogoButton = ({ onMouseEnter, onMouseLeave }) => {
  return (
    <Link 
      to="/events" 
      onMouseEnter={onMouseEnter} 
      onMouseLeave={onMouseLeave} 
      className="transform transition-transform duration-300 ease-in-out hover:scale-105 bg-white rounded-full p-2 shadow-lg" 
      style={{ borderRadius: '10px', opacity: 0.75 }}
    >
      <img src={logo} alt="Unplug Club" className="h-24" />
    </Link>
  );
};

export default LogoButton;
